  `customName` char(20) DEFAULT NULL COMMENT '用户名，唯一',
  `last` float NOT NULL COMMENT '上一次积分',
  `current` float NOT NULL COMMENT '当前积分',
  `explanation` varchar(32) NOT NULL COMMENT '说明，方式为订单的时候写订单编号，VIP降级为系统扣除，积分换U币为U币编号等',
  `type` varchar(32) NOT NULL COMMENT '方式，可能是订单，VIP降级（系统扣除），积分换U币等方式',
  `benefitsDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '操作时间',
  PRIMARY KEY (`benefitsID`),
  KEY `FK_Reference_34` (`customName`),
  CONSTRAINT `FK_Reference_34` FOREIGN KEY (`customName`) REFERENCES `custom` (`customName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='积分明细表';

