DROP TABLE IF EXISTS `book`;
CREATE TABLE `book` (
  `bookID` int(11) NOT NULL AUTO_INCREMENT COMMENT '图书ID',
  `productTypeID` int(11) NOT NULL COMMENT '产品分类ID',
  `bookName` varchar(60) NOT NULL COMMENT '图书名称',
  `author` varchar(20) DEFAULT NULL COMMENT '作者',
  `publisher` varchar(40) NOT NULL COMMENT '出版社',
  `publishingTime` date DEFAULT NULL COMMENT '出版时间',
  `version` varchar(10) DEFAULT NULL COMMENT '版次',
