  CONSTRAINT `FK_Reference_22` FOREIGN KEY (`productTypeID`) REFERENCES `producttype` (`productTypeID`)
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=utf8 COMMENT='图书表';

