INSERT INTO `book` VALUES ('70', '29', '李顺利_专注于Java知识的学习', '李顺利', '南华大学出版社', '2010-05-20', '1', '13786489802', '28', null, , '本博是我平时遇到一些问题的总结和学习过程中的点滴，不能保证我的观点或者思路是正确的，如果有什么意见、建议和问题的请通知我，谢谢。\r\nQQ:506817493\r\nMSN:lishunli@live.com\r\nEmail:leeshunli@qq.com', '1');
INSERT INTO `book` VALUES ('71', '4', '1', '1', '1', '2010-01-01', '1', '1', '100', null, , '1111111111111111111', '1');
INSERT INTO `book` VALUES ('72', '29', 'Java编程思想（第4版）', '（美）埃克尔 著，陈昊鹏 译', ' 机械工业出版社', '2007-06-01', '4', '9787111213826', '108', null, , '本书赢得了全球程序员的广泛赞誉，即使是最晦涩的概念，在Bruce Eckel的文字亲和力和小而直接的编程示例面前也会化解于无形。从Java的基础语法到最高级特性（深入的面向对象概念、多线程、自动项目构建、单元测试和调试等），本书都能逐步指导你轻松掌握。\r\n从本书获得的各项大奖以及来自世界各地的读者评论中，不难看出这是一本经典之作。本书的作者拥有多年教学经验，对C、C++以及Java语言都有独到、深入的见解，以通俗易懂及小而直接的示例解释了一个个晦涩抽象的概念。本书共22章，包括操作符、控制执行流程、访问权限控制、复用类、多态、接口、通过异常处理错误、字符串、泛型、数组、容器深入研究、Java I/O系统、枚举类型、并发以及图形化用户界面等内容。这些丰富的内容，包含了Java语言基础语法以及高级特性，适合各个层次的Java程序员阅读，同时也是高等院校讲授面向对象程序设计语言以及Java语言的绝佳教材和参考书。 \r\n第4版特点： \r\n适合初学者与专业人员的经典的面向对象叙述方式，为更新的Java SE5/6增加了新的示例和章节。\r\n 测验框架显示程序输出。\r\n 设计模式贯穿于众多示例中：适配器、桥接器、职责链、命令、装饰器、外观、工厂方法、享元、点名、数据传输对象、空对象、代理、单例、状态、策略、模板方法以及访问者。\r\n 为数据传输引入了XML，为用户界面引入了SWT和Flash。\r\n 重新撰写了有关并发的章节，有助于读者掌握线程的相关知识。\r\n 专门为第4版以及Java SE5/6重写了700多个编译文件中的500多个程序。\r\n 支持网站包含了所有源代码、带注解的解决方案指南、网络日志以及多媒体学习资料。\r\n 覆盖了所有基础知识，同时论述了高级特性。\r\n 详细地阐述了面向对象原理。\r\n 在线可获得Java讲座CD，其中包含Bruce Eckel的全部多媒体讲座。\r\n在www.MindView.net网站上可以观看现场讲座、咨询和评论。\r\n专门为第4版以及Java SE5/6重写了700多个编译文件中的500多个程序。\r\n支持网站包含了所有源代码、带注解的解决方案指南、网络日志以及多媒体学习资料。\r\n覆盖了所有基础知识，同时论述了高级特性。\r\n详细地阐述了面向对象原理。\r\n在线可获得Java讲座CD，其中包含Bruce Eckel的全部多媒体讲座。\r\n在www.MindView.net网站上可以观看现场讲座、咨询和评论。', '1');
INSERT INTO `book` VALUES ('73', '29', 'Java程序员上班那点事儿', '钟声', '清华大学出版社', '2009-07-01', '1', '9787302205142', '30', null, , '本孖对于即将从事Java职业或初步从业的程序员来说是一本难得的好书。从生存、制胜、发展三个方面入手，为大家展示出程序员求职与工作的一幅3D全景图像。本书中既有在公司中的生存技巧，又有高手达人的进阶策略，既有求职攻略的按图索骥，又有入职后生产环境的破解揭秘。\r\n　　书中浓缩了程序员求职与工作、生存与发展的点滴经验，希望本书能够成为你的朋友。望本书能让即将走向工作岗位的程序员和已经成为程序员的朋友，对工作和软件行业做到既“知己”又“知彼”，在入职前对职业状况清楚了解，入职后对职业方向清晰认识，使大家的工作更加得心应手，更加轻松愉快。', '1');

