-- ----------------------------
-- Table structure for `custom`
-- ----------------------------
DROP TABLE IF EXISTS `custom`;
CREATE TABLE `custom` (
  `customName` char(20) NOT NULL COMMENT '用户名，唯一',
  `customPass` char(48) NOT NULL COMMENT '密码,MD5加密',
  `email` varchar(255) NOT NULL COMMENT '标准的Email',
  `realName` varchar(20) NOT NULL COMMENT '真实姓名',
  `sex` char(2) NOT NULL DEFAULT 'M' COMMENT '性别，''M''代表男，''F''代表女',
  `address` varchar(100) NOT NULL COMMENT '地址',
  `postCode` varchar(6) NOT NULL COMMENT '邮编',
  `mobile` varchar(20) NOT NULL COMMENT '移动电话',
  `phone` varchar(20) DEFAULT NULL COMMENT '固定电话',
  `consumption` float NOT NULL DEFAULT '0' COMMENT '消费总额',
  `uCurrency` float NOT NULL DEFAULT '0' COMMENT 'U币（虚拟）余额',
  `benefits` float NOT NULL DEFAULT '0' COMMENT '积分，可以判断是否为VIP用户',
  `vipFlag` int(11) NOT NULL DEFAULT '0' COMMENT 'vip标记位，直接判断是否为VIP用户',
  `vipDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '成为vip时间',
  `activeFlag` int(11) NOT NULL DEFAULT '1' COMMENT ' 激活标记位',
  PRIMARY KEY (`customName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

